import React, { useEffect } from "react";
import { useParams } from "react-router";

function Post() {
    let { postSlug } = useParams();

    useEffect(() => {
        // Fetch post using the postSlug
    }, [postSlug]);

    return (
        <div className="post">
            <div className="container">
                <h1>Titre du post</h1>
            </div>
        </div>
    );
}

export default Post;
